import axios from "axios";
export async function getStaticProps() {
  const { data } = await axios.get("https://rickandmortyapi.com/api/character");
  return {
    props: { characters: data.results },
  };
}

function Home(props) {
  console.log("props:", props);
  return <h1>Hello</h1>;
}

export default Home;
